import React, { useState } from "react";

export const Login = (props) => {
  const [text, setText] = useState(""); // to set the data of the user
  const [pass, setPass] = useState("");
  const [num, setNum] = useState("");

  // after updating for storing the value after submission we use usehandling

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(text);
    console.log(num);
  };
  return (
    <>
      <form onSubmit={handleSubmit}>
        <label for="text">Name</label>
        <input
          value={text}
          type="text"
          placeholder="Full Name"
          id="text"
          name="text"
        />
        <label for="Roll No.">Roll No.</label>
        <input value={num} type="phone" placeholder="Roll No." id="number" />
        <label for="password">Password</label>
        <input
          value={pass}
          type="password"
          placeholder="password"
          id="password"
          name="password"
        />
        <button type="submit">Log In</button>
      </form>
      <button onClick={props.onFormSwitch}>
        Don't have an account? Registor
      </button>
    </>
  );
};
